  \"2013-03-19T00:33:50.261436\",\n\t\"name\": \"geological-map-of-the-sagavanirktok-b-1-quadrangle-eastern-north-slope-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Alaska Division of Geological & Geophysical
  Surveys (DGGS) has conducted 1:63,360-scale geologic mapping of the Sagavanirktok
  B-1 Quadrangle (640 square kmu0097equivalent to four 7.5 minute quadrangles). This
  geologic map was produced by merging a bedrock geologic map and a surficial geologic
  map of the Eagle A-2 Quadrangle. This mapping project reinterprets micropaleontologic
  correlations for 17 Sagavanirktok Quadrangle wells, and reprocesses data from the
  one publicly-available seismic line. Surface geologic mapping, subsurface-to-surface
  stratigraphic age control, and seismic framework are required to reliably decipher
  the complex geology of this key area of the Brooks Range. Outcrops within the Sagavanirktok
  B-1 Quadrangle are the closest surface expressions of Prudhoe Bay source and reservoir
  rocks. This study yields critical petroleum-related information from these surface
  exposures, and how they relate to the area subsurface stratigraphy.\",\n\t\"license_title\":
